function loadStudentsTable(){let a=[];return $("#studentsTable").DataTable({ajax:{type:"GET",url:"http://localhost:3000/api/Student",data:a=>JSON.stringify(a),dataSrc:"",complete:t=>{t.responseJSON.forEach(t=>{a.push(t.participantNo)})}},columns:[{data:"participantNo",render:a=>'<a href="/student/'+a+'">'+a+"</a>"},{data:"contact.firstName"},{data:"contact.lastName"},{data:"contact.email"},{data:"college",render:a=>a.substring(a.indexOf("#")+1)},{data:"course",render:a=>a.substring(a.indexOf("#")+1)},{data:"currentCredits"},{data:"graduated"}]}),a}$(()=>{if($("body").is(".verifier")){loadStudentsTable()}});